import "./Nav.css";
import { FaBeer } from 'react-icons/fa';

const MobileNavigation = () => {
  return (
    <nav className="MobileNavigation">
      {/* <Fabeer className="Hamburger" /> */}
      <h3> Lets go for a <FaBeer />? </h3>

      <NavLinks />
    </nav>
  );
};
export default MobileNavigation;
